import React from 'react';
import TextField from "@mui/material/TextField";
import SearchIcon from '@mui/icons-material/Search';
import InputAdornment from '@mui/material/InputAdornment';
import Button from '@mui/material/Button';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import Grid from '@mui/material/Grid';
import axios from 'axios';
import { BASE_URL } from '../config/axios';

const baseURL = `${BASE_URL}jsonfake/produtos`;

function LandingPage() {
    const [dados, setDados] = React.useState(null);

    React.useEffect(() => {
        axios.get(baseURL).then((response) => {
            setDados(response.data);
        });
    }, []);

    if (!dados) return null;

    // Exemplo de dados de produtos
    const produtos = [
        { id: 1, nome: 'Produto 1', imagem: 'https://via.placeholder.com/150', preco: 19.99 },
        { id: 2, nome: 'Produto 2', imagem: 'https://via.placeholder.com/150', preco: 29.99 },
        { id: 3, nome: 'Produto 3', imagem: 'https://via.placeholder.com/150', preco: 39.99 },
        { id: 4, nome: 'Produto 4', imagem: 'https://via.placeholder.com/150', preco: 49.99 },
        { id: 5, nome: 'Produto 5', imagem: 'https://via.placeholder.com/150', preco: 59.99 },
        { id: 6, nome: 'Produto 6', imagem: 'https://via.placeholder.com/150', preco: 69.99 }
    ];

    return (
        <div className='container'>
            <h1>Cat√°logo</h1>
            <div className="search">
                <TextField
                    id="outlined-basic"
                    variant="outlined"
                    fullWidth
                    label="Pesquisar"
                    sx={{
                        backgroundColor: '#f0f0f0',
                        borderRadius: '8px'
                    }}
                    InputProps={{
                        style: {
                            color: '#333',
                            borderRadius: '8px'
                        },
                        endAdornment: (
                            <InputAdornment position="end">
                                <SearchIcon style={{ color: '#666' }} />
                            </InputAdornment>
                        )
                    }}
                />
            </div>

            <Grid container spacing={2} style={{ marginTop: '20px' }}>
                {produtos.map((produto) => (
                    <Grid item xs={4} key={produto.id}>
                        <Card>
                            <CardMedia
                                component="img"
                                height="140"
                                image={produto.imagem}
                                alt={produto.nome}
                            />
                            <CardContent>
                                <Typography gutterBottom variant="h5" component="div">
                                    {produto.nome}
                                </Typography>
                                <Typography variant="body2" color="text.secondary">
                                    R$ {produto.preco.toFixed(2)}
                                </Typography>
                                <Button 
                                    variant="contained" 
                                    fullWidth 
                                    style={{ marginTop: '10px' }}
                                    onClick={() => console.log(`Produto ${produto.id} adicionado ao carrinho`)}
                                >
                                    Adicionar ao Carrinho
                                </Button>
                            </CardContent>
                        </Card>
                    </Grid>
                ))}
            </Grid>
        </div>
    );
}

export default LandingPage;
